import React, { Component } from 'react';
import './App.css'
import * as styles from './styles';


class App extends Component {
  var1 = {
    key:'some data'
  }
  render() {
    return (
      <div className="App">
        {var1.key}
      </div>
    );
  }

}

export default App;
